  true,\n\t\"url\": null,\n\t\"notes\": \"<p>Federal law prohibits a physician from
  referring Medicare patients for procedures or services to health care entities in
  which the physician has a financial relationship. This law has exceptions which
  enable physicians to self-refer under certain conditions. This study evaluates the
  effects of self-referral on use rates of surgical pathology services performed in
  conjunction with prostate biopsies and whether such changes are linked to urologist
  self-referral arrangements.</p>n\",\n\t\"license_title\": \"Other License Specified\",\n\t\"extras\":
